import React, { Component } from 'react';

class InputClient extends Component {


    changeHandler = event => {
      this.setState({
        name: event.target.value
      });
    }

    render () {
      return (
        <form>
            <input type="name" 
                   name="name"   
                   value={this.state.name} 
                   onChange={this.changeHandler} 
            />
        </form>
      );       
    }
  }

  export default InputClient;
